import React from 'react';

const About=()=>{
    return(
        <React.Fragment>
            <div className="about">
                <div className="hello">
                    <h1>Hello!</h1>
                </div>
                <div className="text-info">
                    <p></p>
                    
                
                </div>

            </div>
            
        </React.Fragment>

    );


}

export default About;
